--  DDL for Table CHANNELS
--------------------------------------------------------

  CREATE TABLE "CHANNELS" 
   (	"CHANNEL_ID" NUMBER(6,0), 
	"CHANNEL_DESC" VARCHAR2(20 BYTE), 
	"CHANNEL_CLASS" VARCHAR2(20 BYTE), 
	"CHANNEL_CLASS_ID" NUMBER(6,0), 
	"CHANNEL_TOTAL" VARCHAR2(15 BYTE), 
	"CHANNEL_TOTAL_ID" NUMBER(6,0), 
	"CREATE_DATE" DATE DEFAULT SYSDATE, 
	"UPDATE_DATE" DATE DEFAULT SYSDATE
   ) ;
 

   COMMENT ON COLUMN "CHANNELS"."CHANNEL_ID" IS '채널 ID';
 
